var $bm_rt;
var freq, amp, loopTime, t, wiggle1, wiggle2;
freq = 0.3;
amp = 10;
loopTime = thisComp.duration;
t = $bm_mod(time, loopTime);
wiggle1 = wiggle(freq, amp, 1, 0.5, t);
wiggle2 = wiggle(freq, amp, 1, 0.5, $bm_sub(t, loopTime));
$bm_rt = linear(t, 0, loopTime, wiggle1, wiggle2);

var $bm_rt;
var t1, t2, span, delta, t;
if (numKeys > 1 && time > key(numKeys).time) {
    t1 = key(1).time;
    t2 = key(numKeys).time;
    span = $bm_sub(t2, t1);
    delta = $bm_sub(time, t2);
    t = $bm_mod(delta, span);
    $bm_rt = valueAtTime($bm_sum(t1, t));
} else {
    $bm_rt = value;
}
